/*Computing the hinge-loss function*/
float hinge(float score)
{
	if((1-score)>0)
	{
		score = (1-score)/2;
	}else{
		score = 0;
	}
	return score;
}

//calculate the c1 features
void group_c1_feature(float *input_vector, float *output_feature, int window_length){

	//set fft parameters
	uint8_t ifftFlag = 0;
	uint8_t doBitReverse = 1;
	arm_cfft_instance_f32 S = arm_cfft_sR_f32_len4096;

	//iterate through the window and set xfft to the data from the input vector
	int j =0;
	for(int k=0; k < window_length*2; k+=2){
		xfft[k] = input_vector[j];
		xfft[k+1] = 0;
		j++;
	}

	//perform the fft calculation using the current structure and xfft
	arm_cfft_f32(&S, xfft, ifftFlag, doBitReverse);

	//get the complex fft magnitude
	arm_cmplx_mag_f32(xfft, output_feature, window_length/2);

	return;
}

// Spectrogram C1 Norm Local Max
// Returns the normalized truncated features as an array of size returnSize
// window size 2560, subwindow size 256
// returnsize depends on the windowsize and stepsize, if stepsize=subwindowSize then returnSize = windowSize
float32_t* spectrogram_c1_normlocalmax( float* window, int subWindowSize, int stepSize, int bandpassStart, int bandpassStop, int* returnSize){
	int windowSize = 4096;
	int numSubWindows = windowSize/stepSize; // assuming no remainder
	int i,j,k,m;
	int idx;
	float32_t* xfft = (float32_t*)malloc(subWindowSize*2*sizeof(float32_t));

	//If the subwindows do not divide evenly into the window size, change the window size
	if(windowSize%stepSize !=0){
		numSubWindows = floor(windowSize/stepSize);
		windowSize = numSubWindows*stepSize;
	}

	// allocate the 2D spectrogram array
	// arr[numSubWindows][subWindowSize]
	float32_t **arr = (float32_t **)malloc(numSubWindows * sizeof(float32_t*));
	for(i =0;i<numSubWindows;i++){
		arr[i] = (float32_t*)malloc(subWindowSize * sizeof(float32_t));
	}

	//set fft parameters
	uint8_t ifftFlag = 0;
	uint8_t doBitReverse = 1;
	arm_cfft_instance_f32 S = arm_cfft_sR_f32_len256;

	// calculate the spectrogram
	m=0;
	for(i=0;i<windowSize;i=i+stepSize){
		k=0;
		// iterate through the current subwindow and set xfft to that data
		for(j=0;j<subWindowSize*2;j+=2){
			xfft[j] = window[i+k];
			xfft[j+1] = 0;			// imaginary components = 0
			k++;
		}
		//perform the fft calculation using the current structure and xfft
		arm_cfft_f32(&S, xfft, ifftFlag, doBitReverse);

		//get the complex fft magnitude
		arm_cmplx_mag_f32(xfft, arr[m], subWindowSize);
		m++;
	}
	free(xfft);

	// allocate the bandpass array
	int truncated_size = bandpassStop-bandpassStart+1;
	int size_tot = truncated_size*numSubWindows;
	float32_t *arr_trunc = (float32_t *)malloc(size_tot * sizeof(float32_t));

	// truncate the original 2d array and store in arr_trunc
	for(i=0;i<numSubWindows;i++){
		for(j=0;j<truncated_size;j++){
			arr_trunc[i*truncated_size+j]= arr[i][bandpassStart+j];
		}
	}

	// free the original 2d array
		for(i =0;i<numSubWindows;i++){
			free(arr[i]);
		}
		free(arr);

	// Find the max of the unwrapped truncated array
	float32_t* maximum;
	arm_max_f32(arr_trunc, size_tot, maximum, idx);

	// scale the array by 1/maximum;
	float32_t scale = 1.0/(*maximum);
	arm_scale_f32(arr_trunc, scale, arr_trunc, size_tot);

	*returnSize=size_tot;
	return arr_trunc;
}


void glass_break_feature_extractor(float *input_vector, float *output_feature_c1, float *output_feature_c2, int window_length){

	float scale = 0;
	int feature_length = window_length/2; // window length 4096

	//get the fft magnitudes of the start and end windows
	group_c1_feature(input_vector, fft_mag1, window_length);
	group_c1_feature(&input_vector[window_length], fft_mag2, window_length);

	//add the 2 fft magnitudes together
	arm_add_f32(fft_mag2, fft_mag1, fft_mag1, feature_length);

	//get the square root of the sum of the squares
	arm_power_f32(fft_mag1, feature_length, &scale);
	scale = 1.0/sqrtf(scale);

	//scale accordingly and set to the feature for classifier 1
	arm_scale_f32(fft_mag1, scale, output_feature_c1, feature_length);

	//scale the second vector and set it to the feature for classifier 2
	arm_power_f32(fft_mag2, feature_length, &scale);
	scale = 1.0/sqrtf(scale);
	arm_scale_f32(fft_mag2, scale, output_feature_c2, feature_length);

	return;
}

//this function calculates the learners scores of the current input_feature variable and sets them in Params
void get_learner_predictions(classifier_struct_ptr Model, float* input_feature){

	//init counting variables
	int v, c;
	float stdX;

	//iterate through all learners
	for(v=0; v < Model->num_learners; v++){

		//initialize the learner scores
		Model->learner_scores[v] = 0.0;

		//iterate through all the dimensions of the feature vector
		for(c=0; c < Model->feature_length; c++){

			//standardize the dimension
			stdX = (input_feature[c] - Model->Mu[(v * Model->feature_length) + c]) / Model->Sigma[(v * Model->feature_length) + c];

			//multiply by beta
			Model->learner_scores[v] += stdX * Model->Beta[(v * Model->feature_length) + c];
		}
	}

	//Adding biases to the learner scores
	arm_add_f32(Model->learner_scores, Model->Bias, Model->learner_scores, Model->num_learners);
	return;
}

//this function combines learner scores and a coding matrix to get class scores
void combine_learner_scores(int num_learners, int num_classes, float* learner_scores, float* coding_matrix, float* class_scores){

	//init counting variables
	int i, j;
	float numLearnersforclass;

	//iterate through all the classes
	for(i=0; i < num_classes; i++){

		//set the number of active learners for this class to 0
		numLearnersforclass = 0;
		class_scores[i] = 0;

		//iterate though all the learners
		for(j=0; j < num_learners; j++){

			//if the learner was trained on this class, compute the score based on the hinge loss function
			if(coding_matrix[j + (i * num_learners)]!=0){
				class_scores[i] += hinge(learner_scores[j] * coding_matrix[j + (i * num_learners)]);
				numLearnersforclass+=1;
			}
		}

		//divide the class score by the number of active learners
		class_scores[i] /= (-numLearnersforclass);
	}
	return;
}

//this function performs a ecoc prediction based on the current values in Model->learner_scores
void get_ecoc_predictions(classifier_struct_ptr Model){

	//combine the learner scores
	combine_learner_scores(Model->num_learners, Model->num_classes, Model->learner_scores, Model->coding_matrix, Model->class_scores);
	return;
}

//this function performs a full ecoc prediction. Learner scores are computed from the current values of input_feature then combined
void full_ecoc_prediction(classifier_struct_ptr Model, float* input_feature){

	get_learner_predictions(Model, input_feature);
	get_ecoc_predictions(Model);

	return;
}

//this is a function to perform a full prediction with the NXP models and features in X
void glass_break_clasifier_prediction(classifier_struct_ptr Model1, classifier_struct_ptr Model2, float* input_feature_layer1, float* input_feature_layer2){

	//init prediction results
	uint32_t result_index1 = 0;
	uint32_t result_index2 = 0;
	float val1 = 0;
	float val2 = 0;

	//calculate the learner scores
	get_learner_predictions(Model1, input_feature_layer1);

	//shifting the learner scores buffer by 1 to the right
	for(int y=LEARNER_SCORES_BUFFER_LENGTH-1; y>0; y--)
		learner_scores_buffer[y] = learner_scores_buffer[y-1];

	//set the first buffer position to the current learner score
	learner_scores_buffer[0] = Model1->learner_scores[0];

	//calculate the buffered class scores
	combine_learner_scores(LEARNER_SCORES_BUFFER_LENGTH, Model1->num_classes, learner_scores_buffer, Model1->coding_matrix, Model1->class_scores);

	//find the maximum score of the c1 classifier
	arm_max_f32(Model1->class_scores, Model1->num_classes, &val1, &result_index1);

	//perform a full ecoc
	full_ecoc_prediction(Model2, input_feature_layer2);

	//find the maximum score of the c2 classifier
	arm_max_f32(Model2->class_scores, Model2->num_classes, &val2, &result_index2);

	//shift the buffer for the c2 predictions
	for(int y=MODE_BUFFER_LENGTH-1; y>0; y--)
		layer2_buffer[y] = layer2_buffer[y-1];

	//if c1 is 0 set the output to 0, otherwise get the mode of the C2_results prediction buffer
	if(result_index1 == 0){
		layer2_buffer[0] = 0;
		output = 0;
	}else{
		layer2_buffer[0] = result_index2;
		int j, i=0;
		//sum the buffer and check if the length is greater than buff_length/2
		for(j=0; j < MODE_BUFFER_LENGTH; j++)
			i+=layer2_buffer[j];
		if(i >= MODE_THRESHOLD){
			output = 1;
		}
		else{
			output = 0;
		}
	}
	return;
}

//this is a function to load a classifier from global parameters
classifier_struct load_classifier(const float* beta, const float* bias, const float* coding_matrix, const float* mu, const float* sigma, float* learner_scores, float* class_scores, int num_learners, int num_classes, int feature_length){

	//inititalize the classifier
	classifier_struct classifier;

	//set all the classifier parameters
	classifier.Beta = beta;
	classifier.Bias = bias;
	classifier.coding_matrix = coding_matrix;
	classifier.Mu = mu;
	classifier.Sigma = sigma;
	classifier.learner_scores = learner_scores;
	classifier.class_scores = class_scores;
	classifier.num_classes = num_classes;
	classifier.num_learners = num_learners;
	classifier.feature_length = feature_length;
	return classifier;
}

int16_t find_int16_array_max(int16_t *input_vector, int window_length){
	int i;
	int16_t maximum = 0;
	int16_t minimum = 0;

	for(i=0; i<(window_length-1); i++){
		if(input_vector[i] > maximum){
			maximum=input_vector[i];
		}
		if(input_vector[i]<minimum){
			minimum=input_vector[i];
		}
	}
	if(maximum > -minimum){
		return maximum;
	}else{
		return minimum;
	}
}

//this function updates the audio buffer for the predictions
int update_audio_buffer(float* full_buff, int16_t* input_buff, int num_samples)
{
	float32_t max_val = 0;
	uint32_t max_idx;

	//shift the array by num_samples
	memmove(full_buff, &full_buff[num_samples], sizeof(float)*(PREDICTION_BUFFER_LENGTH-num_samples));

	//add the new samples into the end of the buffer
	for(int i=0; i<num_samples; i++){
		full_buff[PREDICTION_BUFFER_LENGTH-num_samples+i] = (float)input_buff[i];
	}
	//max_val = find_int16_array_max(full_buff, PREDICTION_BUFFER_LENGTH);
	arm_max_f32(full_buff, PREDICTION_BUFFER_LENGTH, &max_val, &max_idx);
	return (int)max_val;
}

void RealityAI_glass_break_classify_init()
{
	if(!gb_cf_init){
		//%%%%%%%%%%%%%%%%% Load the classifiers %%%%%%%%%%%%%%%%%
		gb_layer1 = load_classifier(Beta_c1, Bias_c1, Codmat_c1, Mu_c1, Sigma_c1, learner_scores_c1, class_scores_c1, NUM_LEARNERS_c1, NUM_CLASSES_c1, FEATURE_LENGTH_c1);
		gb_layer2 = load_classifier(Beta_c2, Bias_c2, Codmat_c2, Mu_c2, Sigma_c2, learner_scores_c2, class_scores_c2, NUM_LEARNERS_c2, NUM_CLASSES_c2, FEATURE_LENGTH_c2);
		gb_cf_init = 1;
	}
	return;
}

//this is the function to classify the data
NXP_classes RealityAI_glass_break_classify(float *input_vector)
{

	//%%%%%%%%%%%%%%%%% Feature Extraction %%%%%%%%%%%%%%%%%
	glass_break_feature_extractor(input_vector, X1, X2, WINDOW_LENGTH);

	//%%%%%%%%%%%%%%%%% single svm prediction %%%%%%%%%%%%%%
	glass_break_clasifier_prediction(&gb_layer1, &gb_layer2, X1, X2);

	//%%%%%%%%%%%%%%%%% Print max val of input_vector %%%%%%%%%%%%%%%%%
	//find_and_print_max(input_vector, WINDOW_LENGTH);

	return (NXP_classes)output;//NXP Classes start from Classification_error
}

//Shift and Pad Smoothing buffers when no classification occurs
void shift_and_pad_smoothing_buffers(){

	//shift mode buffer by duplicating previous entry
	for(int y=MODE_BUFFER_LENGTH-1; y>0; y--)
		layer2_buffer[y] = layer2_buffer[y-1];
	layer2_buffer[0] = 0; //layer2_buffer[1];

	//shift learner buffer by duplicating previous entry
	for(int y=LEARNER_SCORES_BUFFER_LENGTH-1; y>0; y--)
			learner_scores_buffer[y] = learner_scores_buffer[y-1];
	learner_scores_buffer[0] = 0; //learner_scores_buffer[1];
	return;
}

//Print the Smoothing buffers
void print_smoothing_buffers(){
	for(int y =0;y<MODE_BUFFER_LENGTH;y++)
		printf("%d, ",(int)layer2_buffer[y]);
	printf("\n");
	for(int y =0;y<LEARNER_SCORES_BUFFER_LENGTH;y++)
		printf("%d, ",(int)(1000*learner_scores_buffer[y]));
	printf("\n");
	printf("%d\n", (int) (1000*gb_layer2.learner_scores[0]));
	return;
}


